ath/Science]--Physics--Astronomy Picture of the Day','Venus and Jupiter are Close','#related\nhttp://apod.nasa.gov/apod/image/1507/VenusandJupiterareClose_WangLetian1024.jpg\n\n#Composite Image Credit & Copyright: Wang, Letian\n#Explanation: On June 30, Venus and Jupiter were close in western skies at dusk. Near the culmination of this year\'s gorgeous conjunction, the two bright evening planets are captured in the same telescopic field of view in this image taken after sunset from Bejing, China. As the two bright planets set together in the west, a nearly Full Moon rose above the horizon to the south and east. Imaged that night with the same telescope and camera, the rising Moon from the opposite part of the sky is compared with the planetary conjunction for scale in the digitally composited image. The full lunar disk covers an angle of about 1/2 degree on the sky. Visible as well in binoculars and small telescopes are Venus\' crescent and Jupiter\'s four Galilean moons. Of course, Venus and Jupiter are still close.','ì™¼ìª½ ìœ„ê°€ ëª©ì„±, ì•„ë˜ê°€ ê¸ˆì„±, ì˜¤ëŠ˜ìª½ì´ ë‹¬ ì¸ë“¯.','10.0/10',0,0,0),(100000000,'http://apod.nasa.gov/apod/astropix.html','2015-05-02 03:45:30','2015-05-02 03:45:30','[Physics/Math/Science]--News','Astronomy Picture of the Day','Discover the cosmos! Each day a different image or photograph of our fascinating universe is featured, along with a brief explanation written by a professional astronomer.','NASA ì—ì„œ ìš´ì˜í•˜ëŠ” ì‚¬ì´íŠ¸. ë§¤ì¼ ìš°ì£¼ê´€ë ¨, ê³¼í•™ê´€ë ¨ ì‚¬ì§„ì„ ì—…ë¡œë“œ í•¨.\nì‚¬ì´íŠ¸ê°€ css ì ìœ¼ë¡œ ì¢€ ëœ ê¾¸ë©°ì ¸ìˆëŠ”ê²Œ ì•„ì‰½.','4.5/5',0,0,0),(100000000,'http://appsurprise.co.kr/','2015-05-04 08:37:22','2015-05-04 08:38:28','[IT/Programming]--App','App Surprise ì¨í”„ë¼ì´ì¦ˆ','ê°ì¢… ì„¸ì¼ ì •ë³´ë“¤ (ì˜ë¥˜, í™”ì¥í’ˆ, ìŒì‹ ë“±) ì„ ì˜ ì •ë¦¬í•´ì„œ ë³´ì—¬ì£¼ëŠ” ì‚¬ì´íŠ¸.','í•™êµ í›„ë°°ê°€ ì°½ì—…í•´ì„œ ë§Œë“  ì„œë¹„ìŠ¤. ì™„ì „ ê¹”ë”í•˜ê²Œ ì˜ ë§Œë“ ë“¯ã…‹. ë‚˜ì¤‘ì— ë‚´ ì„œë¹„ìŠ¤ê°€ ì„±ê³µí•˜ë©´ M&A (Mergers and Acquisitions) í•˜