 worth talking about.\n\n#History\nWe started in 2007 wanting to build something new for online communities. Our founders, Daniel Ha and Jason Yan, met in 7th grade but didnâ€™t start working on Disqus until a few years later at UC Davis (right before dropping out).\n\n#Philosophy\nWe believe that how you say something is just as important as what you say. You donâ€™t need to trade in your identity for the ability to speak up. The freedom to express how you want is what lets you be truly authentic.\n\n#Motivation\nDisqus is made for geeks by geeks. Everyone is a geek about something, whether itâ€™s music, food, or science fiction. Sometimes you just need the right space to explore it. Whatever youâ€™re into, we help you get into it.\n\n#The_Missing_Link\nDiscussion and community were among the first great promises of the Internet. But before Disqus, they were neglected by the revolution in other forms of communications. So we built the leading company in a category that, in some ways, we invented. And quietly, made having an online discussion a better experience.\n\n#A_Good_Discussion_is_Great_to_Find\nWhen you visit one of the millions of sites using Disqus, youâ€™re in a connected community, fundamentally different from a traditional destination social network. When youâ€™re on a site using Disqus, youâ€™re exploring a personal passion and in an optimal place to discover new ideas, new people and new stories that you couldnâ€™t find anywhere else.\n\n#Comments_Count\nWith Disqus, publishers experience a more engaged audience that spends more time on site and consumes more content. They grow their audience by being part of a content discovery loop across the Disqus network. They can turn on a new revenue stream through native advertising. Comments no longer cost, they count.\n\n#People_Just_Want_to_Be_Heard\nToday, we represent, in our one billion monthly visitors and over 40 languages, a vital part of the way the world communicates. People no longer just want to read or share the story. They want to be in the story. Disqus will shape the future of online discussion by continually giving people better ways to participate in the communities, events and stories shaping their lives.','DISQUS ì´ë¦„ì—ì„œë„ ì•Œ ìˆ˜ ìˆë“¯ì´ í† ë¡  (DIScuss/Debate), ë¹„ë‚œ (DISs), ì§ˆë¬¸ (QUestion), ìš°ë¦¬ë“¤ (US) ì„ ë„ì™€ì£¼ëŠ” ì„œë¹„ìŠ¤.\n\nëª‡ê°€ì§€ ì•„ì‰¬ìš´ ì ë„ ìˆê¸´í•œë°, ì§€ê¸ˆê¹Œì§€ ë‚˜ì˜¨ ëŒ“ê¸€ ìœ„ì ¯ ì„œë¹„ìŠ¤ ì¤‘ì—ì„œëŠ” ë‹¨ì—° ìœ¼ëœ¸ì´ë¼ê³  ìƒê°í•¨.','4.7/5',0,0,0),(100000000,'https://distill.pub/2016/augmented-rnns/','2017-09-14 02:34:03','2017-09-14 06:16:34','[IT/Programming]--ê¸°ê³„í•™ìŠµ;[IT/Programming]--ê¸°ê³„í•™ìŠµ--RNN','Distill.pub - Attention and Augmented Recurrent Neural Networks','','',NULL,0,0,0),(100000000,'https://docs.mongodb.com/manual/tutorial/install-mongodb-on-os-x/','2017-07-20 04:42:30','2017-07-21 02:12:26','[IT/Programming]--Skelter Labs--Software Engineer Tutorial','https://docs.mongodb.com/manual/tutorial/install-mongodb-on-os-x/','#related\nhttps://cloud.mongodb.com/v2/597036f996e821293346f7d3#clusters\nhttps://docs.mongodb.com/manual/tutorial/getting-started/#getting-started','Getting started ë¶€ë¶„ì˜ Documents and Collections ì€ MongoDB ë¥¼ ì‹¤í–‰í•˜ê³  MongoDB Shell ì— ì ‘ì†í•´ì„œ ì‹¤í–‰í•´ì•¼í•¨.\n\nmongod  # MongoDB ë¥¼ ì‹¤í–‰\nmongo  # MongoDB Shell ì— ì ‘ì†',NULL,0,0,0),(100000000,'https://earth.google.com/web/','2017-07-29 10:15:52','2017-08-17 01:58:21','[IT/Programming]--HTML--Excellent Examples','https://earth.google.com/web/','','3D ë©‹ìˆë‹¤.','10.0/10',0,0,0),(100000000,'https://en.wikipedia.org/wiki/Convolutional_neural_network','2017-08-11 05:34:40','2017-08-11 05:34:40','[IT/Programming]--ê¸°ê³„í•™ìŠµ','wiki - Convolutional neural network','','',NULL,0,0,0),(100000000,'https://en.wikipedia.org/wiki/Principal_component_analysis','2017-08-11 05:32:37','2017-08-11 05:32:37','[IT/Programming]--ê¸°ê³„í•™ìŠµ','wiki - Principal component analysis','','',NULL,0,0,0),(100000000,'https://explorist.futu